import React from "react";

const Note = ({ title, content, props }) => {
  return (
    <div className="note">
      <h1>{title}</h1>
      <p>{content}</p>
      <button onClick={() => this.props.onDelete(props.id)}>Delete</button>
    </div>
  );
};
export default Note;
